function screenshot(element, options = {}) {
    // our cropping context
    let cropper = document.createElement('canvas').getContext('2d');
    // save the passed width and height
    let finalWidth = options.width || window.innerWidth;
    let finalHeight = options.height || window.innerHeight;
    // update the options value so we can pass it to h2c
    if (options.x) {
        //options.x*=browserZoomLevel;
        options.width = finalWidth + options.x;
    }
    if (options.y) {
        //options.y*=browserZoomLevel;
        options.height = finalHeight + options.y;
    }
    // chain h2c Promise
    return html2canvas(element, options).then(c => {

        // do our cropping
        cropper.canvas.width = finalWidth;
        cropper.canvas.height = finalHeight;
        cropper.drawImage(c, -(+options.x || 0), -(+options.y || 0));
        // return our canvas
        return cropper.canvas;
    });
}

// IE does not support outerHTML on SVGElement
if (typeof SVGElement === 'object' && !SVGElement.prototype.outerHTML) {
    Object.defineProperty(SVGElement.prototype, 'outerHTML', {
        get: function () {
            var $node, $temp;
            $temp = document.createElement('div');
            $node = this.cloneNode(true);
            $temp.appendChild($node);
            return $temp.innerHTML;
        },
        enumerable: false,
        configurable: true
    });
}

const getChartsImages = function() {

    const canv = document.createElement('canvas');
    canv.id = 'tempCanv';
    canv.setAttribute('style', 'display: none');
    document.body.appendChild(canv);

    const charts = $(".chart-content");
    const chartsImages = [];
    const arrayPromises = [];
    let promise;

    const extents = $(".brush rect.extent");
    let width;
    for(let i=0; i<extents.length; i++) {
        width = $(extents[i]).attr("width");
        if(width && width !== "0") {
            $(extents[i]).css({"fill-opacity":.125})
                .css({"shape-rendering ":"crispEdges"})
                .css({"fill":"grey"})
                .css({"stroke":"#ff8c00"})
                .css({"stroke-width":2})
        }
    }

    for(let chart=0; chart<charts.length; chart++) {

        if($(charts[chart]).css("display") === "block") {
            promise = getChartImage(charts[chart]);
            if (promise) {
                arrayPromises.push(promise);
            }
        }
    }

    canv.parentNode.removeChild(canv);

    return arrayPromises;
};

const getChartImage = function (element) {

    const canv = document.getElementById('tempCanv');
    let width = $(element).width();
    let height = $(element).height();
    canv.width = width + 150;
    canv.height = height + 150;

    if(element.id === "about") return;

    const title = $(element).parent().find(".chart-title").text().replace('*','');
    const filters = $(element).parent().find(".chart-filters text").text();

    if($('svg', element).length !== 0) {
        let serializer = new XMLSerializer();
        let svg = $('svg', element)[0];
        let svgString = serializer.serializeToString(svg);

        canvg(canv, svgString, {offsetX: 130, scaleHeight: (height), ignoreDimensions:true});
        let d = canv.toDataURL('image/png');
        return new Promise(function(resolve) {resolve({data: d, w: width, h: height, title: title, filters: filters})});
    } else {
        return new Promise(function(resolve) {
            resolve(html2canvas(element).then(c => { return {data: c.toDataURL(), w: width, h: height, title: title, filters: filters} }));
        });
    }
};